		Inputs.var_adesc1.Value = desc;

		string ium = "";
		UDMethods.GetPartIUM(Context.CompanyID, Inputs.var_apart1.Value, out ium);
    Inputs.var_uom1.Value = ium;

		string typeCode = "";
		UDMethods.GetPartTypeCode(Context.CompanyID, Inputs.var_apart1.Value, out typeCode);
		interimtype1 = typeCode;
  }

	/* find first partplant where partplant.company = GetCurrentCompany() and partplant.partnum = Inputs.var_apart1.Value no-lock no-error. */
	bool NonStock = false;
  bool available_partplant = UDMethods.GetPartNonStock(Context.CompanyID, Inputs.var_apart1.Value, out NonStock);
  if (available_partplant) {
    isnonstock1 = NonStock;
  }


  /* Determines Part Type */
if ((interimtype1 == "P") && ( isnonstock1 == false)) {Inputs.var_atype1.Value = "P-STK";}
